import styled from 'styled-components';

export const Footer = styled.footer`
  background-color: #ff6d12;
  color: rgba(255,255,255,0.85) !important;
  border-top-width: 0;
  position: relative;
  padding: 1.25rem 0;
  display: block;
  width:100%;
`

export const Container = styled.div`
  position: relative;
  /* height: 100vh; */
  @media (min-width: 1200px){
      max-width: 1140px;
  }
  width: 100%;
  padding-right: 15px;
  padding-left: 15px;
  margin-right: auto;
  margin-left: auto;
  >div{
    display:flex;
    justify-content:space-between;
    flex-wrap:wrap;
  }

`
